        <footer className='footer'>
            <div className='links-footer'>
                <div className='conheca-nos'>
                    <a>Sobre a Greeng Store</a>
                    <a>Informações Corporativas</a>
                    <a>Acessibilidade</a>
                    <a>Carreiras</a>
                    <a>Comunidade</a>
                </div>
                <div className='afiliacao'>
                    <></>
                </div>
            </div>
        </footer>
    );
}

export default Footer;
